import React from 'react'
import '../GofundNFT.css';
import 'bootstrap/dist/css/bootstrap.min.css';

import comeceAgg from "../images/comeceAgg.png";

function ComeceAgg(){
    return (
        <div>
        <div style={{height:"110px"}}></div>
        
        <div id="IMGComeceagora" >               
              <img src={comeceAgg} class="img-fluid" style={{  position:"absolute", zIndex:'-1'}} alt="artGoTokens">
              </img> 
        

          <div class="row" style={{ width:"100%"}}>
            <div class="col-lg-12 col-md-12 col-sm-12">
                <div id="azevedo" >
                  <h2 style={{fontWeight:"bold"}}  className="gradient">COMECE AGORA !</h2>

                <a href="/OnboardNFT" >
                <button  id="botaoComecarAgora">
                <p  style={{marginTop:"8px" , color:'#454545'}} >
                    Quero emitir meu tokens
                </p>
                </button>
                </a>
                </div>                         
            </div>
          </div>
        </div>              
      </div>
        
    );
}

export default ComeceAgg;
